MATCH (c:Claim {id: 'aba34d0a-b0a5-b435-a5bc-7612ab280dac'})-[:HAS_DIAGNOSED]->(d:Condition)
            OPTIONAL MATCH (a:Allergy)-[:IS_DIAGNOSED_DURING]->(b:Encounter)-[:HAS_ORDERED]->(c:Condition)
            RETURN DISTINCT d.description, a.description;

MATCH (p:Patient)
WHERE p.id IN (p:Patient)<-[:HAS_COVERED]-(e:Encounter)<-[:HAS_PATIENT]-(pa:Payer {id: '26aab0cd-6aba-3e1b-ac5b-05c8867e762c'})
RETURN p.firstName, p.lastName;

MATCH (p:Payer {name: 'Aetna'})-[:HAS_COVERED]->(im:Immunization) 
WHERE im.payerCoverage IS NULL
 RETURN COUNT(DISTINCT im);

MATCH (p:Payer {name: 'NO_INSURANCE'})-[:HAS_COVERED]->(e:Encounter)-[:HAS_PRESCRIBED]->(i:Immunization)
            WHERE NOT EXISTS((p)-[:HAS_COVERED]->(e)-[:HAS_PRESCRIBED]->(i))
            RETURN COUNT(DISTINCT i);

MATCH (m:Medication)-[:IS_COVERED_BY]->(p:Payer {name: 'Medicare'})
WHERE NOT EXISTS((:Encounter)-[:HAS_COVERED]->(m))
RETURN count(m);

MATCH (p:Payer {name: 'UnitedHealthcare'})-[r:HAS_COVERED]->(e:Encounter) 
RETURN COUNT(DISTINCT e.code) 
WHERE NOT EXISTS { e-[:IS_COVERED_BY]->p };

MATCH (e:Encounter)-[:HAS_ORDERED]->(s:Supply)
WHERE s.code = '1137596000'
RETURN DISTINCT e.description;

MATCH (a:Allergy) 
WHERE (a.description = 'Allergy to substance (finding)') 
RETURN DISTINCT a.category;

MATCH (p:Payer {id: 'a735bf55-83e9-331a-899d-a82a60b9f60c'})-[*]->(e:Encounter)
            WHERE e.isEnd = true
            RETURN COUNT(e.id);
